@NabeelAnwar15 This is technically a false argument that lockdown is not equally strict on every group of society. It can not be.

Lockdown is harder on most vulnerable group. It shall be. This is only way to minimize spread.

Then government must protect basic necessities of these groups.

@NabeelAnwar15 And, I've been writing through that gains from lockdown are far far more than costs. 

And, technically, the lockdown is for those who are most vulnerable. Population groups exposed to more risks, such public transport, mundies are natural target. 

Otherwise, why to lockdown.

